import React, {useState, useEffect} from "react";
import frameworks from "./frameworksData";
import Loader from "./Loader";
import { Link } from "react-router-dom";

function Frameworks() {
    const [loading, setLoading] = useState(true);

    useEffect(() => {
        // Simulate a loading time
        const timer = setTimeout(() => setLoading(false), 2000); // 3 seconds delay
        return () => clearTimeout(timer); // Cleanup
    }, []);

    if (loading) {
        return <Loader />; // Show Loader while loading
    }
    return (
        <div>
            <h1>This is My FrameWorks/Technologies!</h1>
            <ul>
                {frameworks.map((framework, index) => (
                <li key={index}>{framework.name}: {framework.experience}</li>
                ))}
            </ul>
            <Link to="/skills">
                <button>Languages</button>
            </Link>
            <Link to="developer">
                <button>Developer Tools</button>
            </Link>
        </div>
    )
}
export default Frameworks;
